import { v4 as uuidv4 } from "uuid";

function getRandomInt(min, max) {
  return Math.floor(Math.random() * (max - min + 1)) + min;
}

function generateRandomVote() {
  const positions = ["Regidor", "Secretario", "Presidente"];
  return {
    _id: uuidv4(),
    position: positions[getRandomInt(0, positions.length - 1)],
    municipalityNumber: getRandomInt(1, 50).toString(),
    lastName: `LastName_${getRandomInt(1, 100)}`,
    firstName: `FirstName_${getRandomInt(1, 100)}`,
    gender: getRandomInt(0, 1) ? "Masculino" : "Femenino",
    party: "sin-definir",
    startDate: "2021-8-27",
    endDate: "2025-8-27",
    memberStatus: "Activo",
    memberPhoto: "",
    password: getRandomInt(1000, 9999).toString(),
    createdAt: new Date().toISOString(),
    updatedAt: new Date().toISOString(),
    __v: 0,
  };
}

const generateJson = (n) => {
  const jsonData = [];

  for (let i = 1; i <= n; i++) {
    const subject = `Dummy Point ${i}`;
    const obj = {
      commission: "Obras y Servicios Públicos",
      required_votes: "Mayoría Simple",
      voting_form: "Economica",
      subject,
      _id: uuidv4(),
      votesFor: [],
      votesAgainst: [],
      votesAbstain: [],
    };

    const votesForCount = getRandomInt(1, 10);
    const votesAgainstCount = getRandomInt(1, 10);
    const votesAbstainCount = getRandomInt(1, 10);

    for (let j = 0; j < votesForCount; j++) {
      obj.votesFor.push(generateRandomVote());
    }

    for (let j = 0; j < votesAgainstCount; j++) {
      obj.votesAgainst.push(generateRandomVote());
    }

    for (let j = 0; j < votesAbstainCount; j++) {
      obj.votesAbstain.push(generateRandomVote());
    }

    jsonData.push(obj);
  }

  return jsonData;
};

export default generateJson;

